import { Button } from 'reactstrap';

export default () => ({ authorizeWithGoogle, authorizeWithFacebook }) => {
    return (
      <>
        <Button onClick={authorizeWithGoogle}  text='Sign In with Google'/>
        <Button onClick={authorizeWithFacebook} text='Sign In with Facebook'/>
        <p>allo</p>
      </>
    )
  }
